import Card from 'react-bootstrap/Card';
import CardGroup from 'react-bootstrap/CardGroup';
import imageFiles from "./GalleryFiles";
import { useState } from 'react';
const Gallery=()=>{
  
  const imData=[
    {
        id:1,
        image:"images/ent_1.jpg",
        name:"Test1",
        description:"hjhfhsdf"
    },
    {
        id:2,
        image:"images/ent_3.jpg",
        name:"test2",
        description:"vdsgdsg"
    },
    {
        id:3,
        image:"images/ent_4.jpg",
        name:"Test3",
        description:"dsfdsf"
    },
    {
      id:3,
      image:"images/ent_4.jpg",
      name:"Test3",
      description:"dsfdsf"
  }
];
const [items, setItem]=useState(imData);
 
    return(
      <>
        <div className="container-fluid nav-bg bg-color:black">
<div className="row">
<div className="col-10 mx-auto">
  <div className="col-md-12 pt-5 pt-lg-0 order-2 order-1 my-2">
    <CardGroup>
    {
       items.map((data, index) => {
     
        return (
              <Card className="my-2">
              <Card.Img variant="top" src={data.image} />
              <Card.Body>
                <Card.Title>{data.name}</Card.Title>
                <Card.Text>
                  {data.description}
                </Card.Text>
              </Card.Body>
              <Card.Footer>
                <small className="text-muted"></small>
              </Card.Footer>
            </Card>
        
        );
      }
      
      )
    }
    
      
      
      </CardGroup>
</div>
</div>
</div>
</div>
      </>
    );
    }
    
    export default Gallery;
